import "./Expense.css";

function Expense(props) {
  const one = props[0];
  const two = props[1];
  const three = props[2];
  const four = props[3];

  return (
    <div className="expenses">
      <div>
        title={one.title}
        amount={one.amount}
        date={one.date}
      </div>
      <div>
        title={two.title}
        amount={two.amount}
        date={two.date}
      </div>
      <div>
        title={three.title}
        amount={three.amount}
        date={three.date}
      </div>
      <div>
        title={four.title}
        amount={four.amount}
        date={four.date}
      </div>
    </div>
  );
}

export default Expense;
